import React, { useEffect, useRef } from "react";
import mapboxgl from "mapbox-gl";
import "mapbox-gl/dist/mapbox-gl.css";

mapboxgl.accessToken =
  "pk.eyJ1IjoibWFwZmVhbiIsImEiOiJjbTNuOGVvN3cxMGxsMmpzNThzc2s3cTJzIn0.1uhX17BCYd65SeQsW1yibA";

const FROST_CLIENT_ID = "12f68031-8ce7-48c7-bc7a-38b843f53711";
const FROST_CLIENT_SECRET = "08a75b8d-ca70-44a9-807d-d79421c082bf";

const WeatherStationsMap = () => {
  const mapContainer = useRef(null);
  const mapRef = useRef(null);

  const frostToGeoJSON = (stations) => {
    const features = stations
      .filter((station) => station.geometry && station.geometry.coordinates)
      .map((station) => ({
        type: "Feature",
        geometry: {
          type: "Point",
          coordinates: station.geometry.coordinates,
        },
        properties: {
          id: station.id,
          name: station.name,
          shortName: station.shortName || "Unknown",
          country: station.country || "Norway",
        },
      }));

    console.log(`âœ… Converted ${features.length} stations into GeoJSON features`);
    console.log("ðŸ” First station:", features[0]);
    return {
      type: "FeatureCollection",
      features,
    };
  };

  const fetchStations = async () => {
    try {
      const frostAuth = btoa(`${FROST_CLIENT_ID}:${FROST_CLIENT_SECRET}`);
      console.log("ðŸŒ Fetching stations from Frost API...");

      const response = await fetch(
        "/frost/sources/v0.jsonld?types=SensorSystem",
        {
          headers: {
            Authorization: `Basic ${frostAuth}`,
            Accept: "application/json",
          },
        }
      );

      console.log("ðŸ”„ Response status:", response.status);

      if (!response.ok) {
        throw new Error(`âŒ Frost API error: ${response.status}`);
      }

      const data = await response.json();
      console.log("ðŸ“¦ Frost API raw data:", data);

      // Check if proxy may be returning invalid format
      if (!data || typeof data !== "object" || !Array.isArray(data.data)) {
        console.error("ðŸš¨ Frost API response is not valid. Possible proxy issue.");
        return [];
      }

      return data.data || [];
    } catch (error) {
      console.error("ðŸš¨ Error fetching Frost data:", error);
      return [];
    }
  };

  useEffect(() => {
    const initMap = async () => {
      if (mapRef.current) return;

      console.log("ðŸ—ºï¸ Initializing Mapbox map...");

      mapRef.current = new mapboxgl.Map({
        container: mapContainer.current,
        style: "mapbox://styles/mapbox/streets-v11",
        center: [10.75, 59.91],
        zoom: 5,
      });

      mapRef.current.resize(); // ðŸ›  Ensure map renders correctly in container

      new mapboxgl.Marker()
        .setLngLat([10.75, 59.91])
        .setPopup(new mapboxgl.Popup().setText("Test Marker"))
        .addTo(mapRef.current);

      const stations = await fetchStations();
      console.log(`ðŸ“Š Total stations fetched: ${stations.length}`);

      if (stations.length === 0) {
        console.warn("âš ï¸ No stations returned from Frost API");
        return;
      }

      const geojson = frostToGeoJSON(stations);
      console.log("ðŸŒ GeoJSON:", geojson);
      console.log("ðŸ” First station coords:", geojson.features[0]?.geometry.coordinates);

      // â— Add debug info to detect proxy problems
      console.log("ðŸ§ª typeof geojson:", typeof geojson);
      console.log("ðŸ§ª Array.isArray(geojson.features):", Array.isArray(geojson.features));
      console.log("ðŸ§ª Sample feature:", geojson.features[0]);

      mapRef.current.on("load", () => {
        console.log("ðŸ›°ï¸ Mapbox loaded, adding station data...");

        // Add source and confirm
        mapRef.current.addSource("stations", {
          type: "geojson",
          data: geojson,
        });

        console.log("ðŸ“¡ Current sources:", mapRef.current.getStyle().sources);

        // Confirm Mapbox sees the source
        const source = mapRef.current.getSource("stations");
        console.log("ðŸ“¤ Mapbox source object:", source);

        if (source && source._data) {
          console.log("ðŸ“¤ Source _data (first 1):", source._data.features?.slice(0, 1));
        } else {
          console.warn("âš ï¸ 'stations' source not found or missing data â€” possible proxy problem.");
        }

        // Add a few markers manually to test coordinates
        geojson.features.slice(0, 5).forEach((feature, i) => {
          const coords = feature.geometry.coordinates;
          const name = feature.properties.name;
          new mapboxgl.Marker({ color: "purple" })
            .setLngLat(coords)
            .setPopup(new mapboxgl.Popup().setText(`Station ${i + 1}: ${name}`))
            .addTo(mapRef.current);
        });

        mapRef.current.fitBounds(
          [
            [4, 57],
            [31, 72],
          ],
          { padding: 20 }
        );

        // Add main layer for all stations
        mapRef.current.addLayer({
          id: "stations-layer",
          type: "circle",
          source: "stations",
          paint: {
            "circle-radius": [
              "interpolate",
              ["linear"],
              ["zoom"],
              0, 4,
              5, 6,
              10, 10,
              15, 16,
            ],
            "circle-color": "#ff6600",
            "circle-stroke-width": 1,
            "circle-stroke-color": "#fff",
            "circle-opacity": 0.9,
          },
        });

        console.log("âœ… Station layer added to map");

        console.log(
          "ðŸ§© Map layers:",
          mapRef.current.getStyle().layers.map((l) => l.id)
        );

        // Add interactivity
        mapRef.current.on("click", "stations-layer", (e) => {
          const props = e.features[0].properties;
          const coords = e.features[0].geometry.coordinates;

          new mapboxgl.Popup()
            .setLngLat(coords)
            .setHTML(`
              <strong>${props.name}</strong><br/>
              ID: ${props.id}<br/>
              Country: ${props.country}
            `)
            .addTo(mapRef.current);
        });

        mapRef.current.on("mouseenter", "stations-layer", () => {
          mapRef.current.getCanvas().style.cursor = "pointer";
        });

        mapRef.current.on("mouseleave", "stations-layer", () => {
          mapRef.current.getCanvas().style.cursor = "";
        });
      });
    };

    initMap();
  }, []);

  return (
    <div
      ref={mapContainer}
      style={{ width: "100%", height: "100vh", borderRadius: "10px" }}
    />
  );
};

export default WeatherStationsMap;
